import React, { useRef, useEffect, useState } from 'react';

const Header = () => {
  const headerRef = useRef(null);
  const [isMenuOpen, setMenuOpen] = useState(false);

  useEffect(() => {
    const stickyHeaderFunc = () => {
      if (
        document.body.scrollTop > 80 ||
        document.documentElement.scrollTop > 80
      ) {
        headerRef.current.classList.add('sticky_header');
      } else {
        headerRef.current.classList.remove('sticky_header');
      }
    };

    window.addEventListener('scroll', stickyHeaderFunc);
    return () => window.removeEventListener('scroll', stickyHeaderFunc);
  }, []);

  const handleClick = (e) => {
    e.preventDefault();
    const targetAttr = e.target.getAttribute('href');
    const targetElement = document.querySelector(targetAttr);

    if (targetElement) {
      const location = targetElement.offsetTop;

      window.scrollTo({
        top: location - 80,
        left: 0,
        behavior: 'smooth',
      });
    }
  };

  const toggleMenu = () => setMenuOpen(!isMenuOpen);

  return (
    <header
      ref={headerRef}
      className={`header ${isMenuOpen ? 'menu-open' : ''}`}
    >
      {/* Logo */}
      <div className="container">
        <div className="logo-menu-wrapper">
          <div className="logo">
            <span className="logo-text">AB</span>
            <div className="logo-name">
              <h2>Akshay</h2>
              <p>Balte</p>
            </div>
          </div>
          {/* Menu */}
          <div className={`menu ${isMenuOpen ? 'open' : ''}`}>
            <ul className="menu-items">
              <li><a href="#home" onClick={handleClick}>Home</a></li>
              <li><a href="#about" onClick={handleClick}>About</a></li>
              <li><a href="#services" onClick={handleClick}>Services</a></li>
              <li><a href="#portfolio" onClick={handleClick}>Portfolio</a></li>
              <li><a href="#contact" onClick={handleClick}>Contact</a></li>
              <li><a href="#skills" onClick={handleClick}>Skills</a></li>
            </ul>
          </div>
          {/* Menu Icon */}
          <div className="mobile-menu-icon" onClick={toggleMenu}>
            <i className="ri-menu-line"></i>
          </div>
        </div>
      </div>

      <style jsx>{`
        .header {
          width: 100%;
          height: 80px;
          display: flex;
          align-items: center;
          justify-content: center;
          transition: background-color 0.3s;
          position: relative;
        }

        .sticky_header {
          background-color: #333;
          color: #fff;
          box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
        }

        .container {
          width: 90%;
          max-width: 1200px;
          display: flex;
          align-items: center;
          justify-content: space-between;
        }

        .logo-menu-wrapper {
          display: flex;
          align-items: center;
          width: 100%;
          justify-content: space-between;
        }

        .logo {
          display: flex;
          align-items: center;
        }

        .logo-text {
          width: 35px;
          height: 35px;
          background-color: #1e40af;
          color: white;
          text-align: center;
          line-height: 35px;
          font-size: 18px;
          font-weight: 500;
          border-radius: 50%;
        }

        .logo-name {
          margin-left: 10px;
        }

        .logo-name h2, .logo-name p {
          margin: 0;
          color: #f3f4f6;
        }

        .logo-name h2 {
          font-size: 24px;
          font-weight: 700;
        }

        .logo-name p {
          font-size: 16px;
          font-weight: 500;
        }

        .menu {
          display: flex;
          gap: 20px;
        }

        .menu.open {
          display: block;
        }

        .menu-items {
          display: flex;
          gap: 20px;
          list-style: none;
          margin: 0;
          padding: 0;
        }

        .menu-items li a {
          color: #f3f4f6;
          text-decoration: none;
          font-weight: 500;
          transition: color 0.3s;
        }

        .menu-items li a:hover {
          color: #1e40af;
        }

        .mobile-menu-icon {
          display: none;
          font-size: 24px;
          cursor: pointer;
          color: #1e40af;
        }

        @media (max-width: 768px) {
          .menu {
            display: none;
          }

          .menu.open {
            display: block;
            position: absolute;
            top: 80px;
            left: 0;
            width: 100%;
            background-color: #333;
            padding: 10px;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
          }

          .menu-items {
            flex-direction: column;
            gap: 10px;
          }

          .mobile-menu-icon {
            display: block;
          }
        }
      `}</style>
    </header>
  );
};

export default Header;
